import teste from '@/services/teste.service'

const pageTwoModule = {
  state: () => ({
    teste: [],
  }),
  mutations: {
    mudarEstadoTwo(state, newState) {
      state.teste = newState;
    },
  },
  actions: {
    async httpUserDetailsGet({ commit }) {
      try {
        let res = await teste.userDetailGet();
        let data = res.data;

        commit('mudarEstadoTwo', data);
      } catch (err) {
        console.log(err);
      }
    },
  },
};

export default pageTwoModule
